{|{{Infobox ship begin}} {{Infobox ship image | Ship image= | Ship caption= }} {{Infobox ship class overview | Name= | Builders= | Operators={{Navy|Australia}} | Class before= | Class after= | Subclasses= | Cost= | Built range= | In service range= | In commission range= | Total ships building= | Total ships planned= | Total ships completed=4 | Total ships cancelled= | Total ships active= | Total ships laid up= | Total ships lost= | Total ships retired= | Total ships scrapped= | Total ships preserved= }} {{Infobox ship characteristics | Hide header= | Header caption=<ref>{{cite web |url=http://members.dodo.com.au/~sjbatche/my_drawings.htm |title=My Model Drawings |work=members.dodo.com.au |year=2012 |accessdate=16 June 2012}}</ref> | Ship type= Harbour [[Tugboat|tug]] | Ship tonnage= | Ship displacement= {{Convert|47.5|LT|t|0|lk=on}} | Ship length= {{Convert|15.2|m|ftin|abbr=on}} [[Length overall|o/a]] | Ship beam= {{Convert|4.6|m|ftin|abbr=on}} | Ship height= | Ship draught= | Ship power= | Ship propulsion= | Ship speed= {{Convert|9.5|kn|lk=in}} | Ship range= | Ship endurance= | Ship capacity= | Ship complement=3 | Ship armament= | Ship armour= | Ship notes= }} |} The '''''Bronzewing''-class harbour tug''' was a class of four tugs constructed for the [[Royal Australian Navy]].{{sfn|Wertheim|2007|p=33}} ''HTS 503'' was given to Papua New Guinea in 1974. They were constructed by Stanard Bros, [[Sydney]], except for ''HTS Mollymawk'' (504), that was constructed by Perris Engineering, [[Brisbane]].
*''Bronzewing'' (HTS 501) *''Currawong'' (HTS 502) *''HTS 503'' *''Mollymawk'' (HTS 504) ''Bronzewing'' and ''Currawong'' are currently on loan from the RAN to [[Sydney Heritage Fleet]], where they are often used in support of [[James Craig (barque)]] and other heritage ships in the Fleet.
